import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import logo from '../../../images/icon.png';

const Navbar = () => {
    return (
        <div className="full-container">
            <section className="nav-section">
            <nav className="navbar navbar-expand-lg navbar-light p-0">
                <div className="container px-0">
                    <a className="navbar-brand d-flex align-items-center" href="https">
                        <img src={logo} alt="Icon" className="logo" />
                        <h1 className="pl-3">Pixel</h1>
                    </a>
                    {/* <a className="nav-link" href="https">Home <span className="sr-only">(current)</span></a> */}
                    {/* <Link className="text-light text-center"> Upload Your Image</Link> */}
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse justify-content-end" id="navbarNavAltMarkup">
                        <div className="navbar-nav">
                            {/* <a className="nav-link active" href="#">Home <span className="sr-only">(current)</span></a>
                        <a className="nav-link" href="#">Features</a>
                        <a className="nav-link" href="#">Pricing</a>
                        <a className="nav-link disabled" href="#" aria-disabled="true">Disabled</a> */}
                            <a className="nav-link active px-3" href="https">Home <span className="sr-only">(current)</span></a>
                            <a className="nav-link px-3" href="https">Dashboard</a>
                            <button className="btn btn-outline-success mx-3" type="button"><Link className="">Sign In</Link></button>
                            <button className="btn btn-primary ml-3"><Link className="text-light">Sign Up</Link></button>
                        </div>
                    </div>
                </div>
            </nav>
            </section>

        </div>
    );
};

export default Navbar;
